        try {
            const res = await fetch('/logout', {
                method: "GET",
                headers: {
                    Accept: "appllication/json",
                    "Content-Type": "application/json"
                },
                credentials: "include"
            });

            // const data = await res.json();
      
            if(res.status === 201){
                return window.alert("logout successfully");
            }
         
            if(!res.status===200  ){
                console.log('bc');
